import React from 'react';

const Todos = (props) =>{
const {todos,deleteTodo } = props;
const TodoList = todos.length ? ( 
    todos.map(todo => {
        return (
            <div key={todo.id}> 
                <span className="listitem" onClick={()=>{deleteTodo(todo.id)}}>{todo.todocaption}</span>
            </div>
        )
    })
) : ( <p>No Left Todo </p>)
return (
    <div>
        {TodoList}
    </div>
)
}

export default Todos
